/* Trigger structure for table `hapus_penjualan` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `pengembalianstock` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `pengembalianstock` AFTER INSERT ON `hapus_penjualan` FOR EACH ROW BEGIN
	SET @cabangdisplay = (SELECT cabang_gudangdisplay FROM m_cabang	 WHERE cabang_id = new.cabang);
	UPDATE t_stok_gudang SET stok_gudang_jumlah = stok_gudang_jumlah + new.barangqty WHERE m_barang_id = new.barang AND m_gudang_id = @cabangdisplay;
	UPDATE t_stok_gudang SET stok_gudang_jumlah = stok_gudang_jumlah + new.barangqtygudang WHERE m_barang_id = new.barang AND m_gudang_id = new.gudang;
	Update tb_penjualan set status = 1 where penjualan_id = new.penjualan;
	
    END */$$


DELIMITER ;

/* Trigger structure for table `t_penerimaan_barangdet` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `delcomorder` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `delcomorder` AFTER UPDATE ON `t_penerimaan_barangdet` FOR EACH ROW BEGIN
    -- declare orderdet_id int;
    
    SET @orderdet_id = (SELECT a.orderdet_id FROM t_orderdet a
			 WHERE t_order_id = (SELECT a.t_order_id FROM t_penerimaan_barang a
			 LEFT JOIN t_penerimaan_barangdet b ON b.t_penerimaan_barang_id = a.penerimaan_barang_id
			 WHERE b.penerimaan_barangdet_id = old.penerimaan_barangdet_id AND b.m_barang_id = old.m_barang_id));
			 
	UPDATE t_orderdet SET statusdelcom = old.statusdelcom WHERE t_orderdet_id = @orderdet_id;
    END */$$


DELIMITER ;

/* Trigger structure for table `tb_penjualan_details` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `updatestockdaripenjualan` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `updatestockdaripenjualan` AFTER INSERT ON `tb_penjualan_details` FOR EACH ROW BEGIN
	DECLARE cabangdisplay INTEGER;
	DECLARE cabanggudang INTEGER;
	
	SELECT m_cabang.cabang_gudangdisplay INTO cabangdisplay FROM m_cabang 
	WHERE m_cabang.cabang_id = (SELECT tb_penjualan.branch FROM tb_penjualan
				    LEFT JOIN tb_penjualan_details ON tb_penjualan_details.penjualan = tb_penjualan.penjualan_id
				    WHERE tb_penjualan.penjualan_id = new.penjualan LIMIT 1);
				    
	UPDATE t_stok_gudang SET stok_gudang_jumlah = stok_gudang_jumlah - new.barang_qty 
	WHERE m_barang_id = new.barang AND m_gudang_id = (SELECT m_cabang.cabang_gudangdisplay FROM m_cabang 
	WHERE m_cabang.cabang_id = (SELECT tb_penjualan.branch FROM tb_penjualan
				    LEFT JOIN tb_penjualan_details ON tb_penjualan_details.penjualan = tb_penjualan.penjualan_id
				    WHERE tb_penjualan.penjualan_id = new.penjualan LIMIT 1));			      
	
	UPDATE t_stok_gudang SET stok_gudang_jumlah = stok_gudang_jumlah - new.item_getFromGudang 
	WHERE m_barang_id = new.barang AND m_gudang_id = (SELECT m_gudang.gudang_id FROM m_gudang 
	WHERE m_gudang.m_cabang_id = (SELECT tb_penjualan.branch FROM tb_penjualan
				    LEFT JOIN tb_penjualan_details ON tb_penjualan_details.penjualan = tb_penjualan.penjualan_id
				    WHERE tb_penjualan.penjualan_id = new.penjualan LIMIT 1) and m_gudang.gudang_id != cabangdisplay);
	
    END */$$


DELIMITER ;

